				$criteria->add(RengFacPeer::CO_ART, $this->co_art);

				$this->collRengFacs = RengFacPeer::doSelectJoinTabulado($criteria, $con, $join_behavior);
			}
		} else {
			// the following code is to determine if a new query is
			// called for.  If the criteria is the same as the last
			// one, just return the collection.

			$criteria->add(RengFacPeer::CO_ART, $this->co_art);

			if (!isset($this->lastRengFacCriteria) || !$this->lastRengFacCriteria->equals($criteria)) {
				$this->collRengFacs = RengFacPeer::doSelectJoinTabulado($criteria, $con, $join_behavior);
			}
		}
		$this->lastRengFacCriteria = $criteria;

		return $this->collRengFacs;
	}

	/**
	 * Resets all collections of referencing foreign keys.
	 *
	 * This method is a user-space workaround for PHP's inability to garbage collect objects
	 * with circular references.  This is currently necessary when using Propel in certain
	 * daemon or large-volumne/high-memory operations.
	 *
	 * @param      boolean $deep Whether to also clear the references on all associated objects.
	 */
	public function clearAllReferences($deep = false)
	{
		if ($deep) {
			if ($this->collRengFacs) {
				foreach ((array) $this->collRengFacs as $o) {
					$o->clearAllReferences($deep);
				}
			}
		} // if ($deep)

		$this->collRengFacs = null;
			$this->aLinArt = null;
			$this->aCatArt = null;
			$this->aSubLin = null;
			$this->aColores = null;
			$this->aProceden = null;
			$this->aProv = null;
			$this->aUnidadesRelatedByUniVenta = null;
			$this->aUnidadesRelatedBySuniVenta = null;
			$this->aTabulado = null;
	}


  public function __call($method, $arguments)
  {
    if (!$callable = sfMixer::getCallable('BaseArt:'.$method))
    {
      throw new sfException(sprintf('Call to undefined method BaseArt::%s', $method));
    }

    array_unshift($arguments, $this);

    return call_user_func_array($callable, $arguments);
  }


} // BaseArt
